window.bookSummaryJSON = "<p><b>Audie Award Nominee, Humor, 2013</b></p> <p>For fans of Tina Fey and David Sedaris - Internet star Jenny Lawson, aka The Bloggess, makes her literary debut. </p> <p>Jenny Lawson realized that the most mortifying moments of our lives - the ones we'd like to pretend never happened - are in fact the ones that define us. In <i>Let's Pretend This Never Happened,</i> Lawson takes listeners on a hilarious journey recalling her bizarre upbringing in rural Texas, her devastatingly awkward high school years, and her relationship with her long-suffering husband, Victor. </p> <p>Chapters include: \"Stanley the Magical, Talking Squirrel\", \"A Series of Angry Post-It Notes to My Husband\", \"My Vagina Is Fine. Thanks for Asking\", and \"And Then I Snuck a Dead Cuban Alligator on an Airplane\".</p> <p></p>"; 
